import React, {Component} from 'react';
import './Hello.css';


class Hello extends Component{
	render(){
		return(
			<div className='tc'>
			
			<h1>Hello World !!!!</h1>
			<p><b> Welcome to React</b></p>
			</div>


			);
	}
}

export default Hello;
